sys_variable_value.value:
(function execute(inputs, outputs) {

    var productName = inputs.product;
    var variantName = inputs.product_variant;


    var productGr = new GlideRecord('x_rptp_smartinte_0_integrationproducts'); 
    productGr.addQuery('productid', productName);
    productGr.query();
    if (!productGr.next()) {
    outputs.product = 'Product Name does not exist.';
    } else {
    var productSysId = productGr.getUniqueValue(); 

    var variantGr = new GlideRecord('x_rptp_smartinte_0_integrationproductvariants');
    variantGr.addQuery('variant_id', variantName);
    variantGr.query();
    if (!variantGr.next()) {
        outputs.productvariant = 'Variant Name does not exist.';
    } else {

        if (variantGr.product != productSysId) {
            outputs.errormessage = 'The variant does not belong to the specified product.';
        }
    }
}

    var age = parseInt(inputs.age, 10);
    var investmentAmount = parseFloat(inputs.min_investment_amount);

    if (isNaN(age) || age < 30 || age > 60) {
        outputs.age = 'Age must be between 30 and 60.';
        
    }

    if (isNaN(investmentAmount) || investmentAmount < 50000) {
        outputs.investment = 'Investment amount must be at least 50,000.';
        
    }

    outputs.successMessage = 'Validation successful.';
   
})(inputs, outputs);

